var u={p:'" filterUnits="objectBoundingBox" x="0%" y="0%" width="100%" height="100%"><feFlood flood-color="',d:"15550 Rockfield Blvd,\nIrvine, CA 92618\n\nEmail\nhelp@derivative.dev\n\nWould you like to integrate one of our products into your school? You can reach us at:\n+ 1 (714) 900-3719",s:'<svg width="0" height="0" style="position:absolute"><filter id="_fcf',Y:"Add events so event goers can find and go to events.",Z:"Adding a custom Page Button allows administrators to easily link Integral users to a website to do purchasing, sign up, check in, or directions in a user friendly manner.",j:"Customize your app to create a truly unique experience",H:"Patrick is a first-year EECS student at UC Berkeley and a founding member of Derivative. He is responsible for overall design, development, marketing, and direction of Derivative.",o:"Schedule school schedules for high schools.",V:"Stream has been disposed.\nAn ImageStream is considered disposed once at least one listener has been added and subsequently all listeners have been removed and no handles are outstanding from the keepAlive method.\nTo resolve this error, maintain at least one listener on the stream, or create an ImageStreamCompleterHandle from the keepAlive method, or create a new stream for the image.",J:"SystemChrome.setApplicationSwitcherDescription",x:"The Bell Schedule Presets section gives administrators the ability to create presets for bell schedules that may occur throughout the year that can be assigned to any day.",_:"The Calendar is a key feature of Integral, explaining its position to the left of the home screen, allowing quick access with one swipe. Users are able to swipe left or right on the Calendar to switch to different months. When the user selects different dates a quick preview of the bell schedule is shown below the Calendar, indicating when school starts and ends on that day. To the right of that text, a button is available which when tapped, opens a page listing the selected day\u2019s full bell schedule. Below these two elements are an Events button on the left and a Sports button on the right, allowing a user to view the selected day\u2019s events and sports games, respectively. The dates marked with blue text indicate to the user an abnormal bell schedule taking place on that day.",e:"The Edit function gives administrators the ability to quickly edit parameters of an event, such as what time it starts, without having to re-enter all of the event information.",F:"The Events page gives administrators the abilty to add events to be viewed in the Integral app. Events can be anything from lunchtime activities to concerts to school plays. Administrators are able to set the date, time, location, and category for the event, along with setting a custom button for users of Integral to click on, such as a link to purchase tickets for a concert. Finally, events can be added and deleted.",M:"The Schedule page in the Integral Admin Platform gives administrators the ability to create schedule presets and use those presets to assign bell schedules to each day in the school year. These changes are automatically pushed to the Integral app, giving the user the latest and most up to date information regarding schedule changes.",D:"The This Week section gives administrators a quick overview of the upcoming week. This includes the date, what bell schedule is in use, and what time school starts and ends.",C:"The Toolkit is just a swipe away to the right of the home screen and contains features that while accessed less often are still useful. The Toolkit dynamically adjusts what items are shown depending on what items are enabled by the school administrator in the Integral Admin Platform. The ID Card feature allows users to display their ID number as a bar code, which is useful in certain situations at school, such as book checkout in the library. The Sports feature allows users to view upcoming sports games and past sports scores for all their favorite sports. The Events page allows users to browse all upcoming school events. The News feature gives users the ability to read their school newspaper. Finally, the Clubs feature allows users to view information about all the clubs at their school.",n:"The custom color picker system allows schools to select a primary and secondary color. Preset color combinations can expedite setup or even provide inspiration.",c:"The element being rebuilt at the time was index ",G:"The home screen of Integral features Integral\u2019s flagship feature, the schedule dial. This dial at the top of the screen counts down to the next schedule item, while the text inside the tile dynamically responds to let the user know what is coming up. Two buttons are situated on either side of the dial. The left button allows users to quickly check on school announcements and read past push notifications. The right button gives the user access to the app\u2019s settings, allowing the user to personalize the app to his or her liking. Below the schedule dial are two buttons, schedule and events. These buttons allow the user to see a few upcoming schedule or event items for the day, with the option at the bottom to jump to the full bell schedule or events page for the day.",f:"To the right of the color picker screen is a preview of Integral with the chosen colors. This allows schools to ensure that their app will look as good as they think it will.",K:"Try clicking the arrows to navigate through the app!",a:"We believe that designing and developing mobile platforms and services represent our greatest opportunity to innovate and positively impact our community.",i:"When the school administrator is undergoing the registration process, they are able to configure a wide array of settings and features to perfectly tailor the app to their school. This even includes the appearance of the app, enabling the students to see their school\u2019s colors featured in Integral. Thanks to this customization, there are nearly infinite ways that Integral can be setup.",I:"`null` encountered as case in a switch expression with a non-nullable enum type.",E:"`null` encountered as the result from expression with type `Never`."}
